import Header from './components/Header';
import './styles/Header.css'; 
function App() {
  return (
    <div>
      <Header />
      {/* 여기에 본문 내용이 들어갈 수 있어 */}
      <main style={{ padding: '24px' }}>
        <h1>메인 콘텐츠 영역</h1>
        <p>ㅇㅅㅇ</p>
      </main>
    </div>
  );
}

export default App;
